import React, { Component } from 'react'
import ReactDOM from 'react-dom';
// import logo from './logo.svg';
// import './App.css';

export default class App extends Component {
  render() {
    return (
      <div>
        <h1 className="bg-success text-white text-center p-2">
          Kelly McNutt Sucks
        </h1>
          <p>
          Babel is used to turn ES6-->ES5 code for useability on non-compatible devices
          </p>
      </div>
    );
  }
}
class ProductList extends React.Component {
  render() {
    const product = Seed.products[0];
    return (
      <div className='ui unstackable items'>
        <Product
          id={product.id}
          title={product.title}
          description={product.description}
          url={product.url}
          votes={product.votes}
          submitterAvatarUrl={product.submitterAvatarUrl}
          productImageUrl={product.productImageUrl}
        />      
      </div>
    );
  }
}
class Product extends React.Component {
  render() {
    return (
      <div className='item'>
        <div className='image'>
          <img src={require('./image-aqua.jpg')} />
        </div>
        <div className='middle aligned content'>
          <div className='description'>
            <a>BigDick </a>
            <p>A large Penis </p>
          </div>
          <div className='extra'>
            <span>Submitted by:</span>
             <div>
             <img
              className='ui avatar image'
              src={require('./daniel.jpg' )}
              />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

ReactDOM.render(
  <ProductList />,document.getElementById('content')
);
